import React, { useRef, useState, useLayoutEffect, useEffect } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Histogram from "./Histogram";

const STYLES = {
    UL: {
        listStyleType: 'none',
        margin: 0,
        padding: 0,
        overflow: 'hidden',
        backgroundColor: '#333333'
    },
    LI: {
        float: 'left'
    },
    LI_A: {
        display: 'block',
        color: 'white',
        textAlign: 'center',
        padding: '16px',
        textDecoration: 'none',
        ':hover': {
            backgroundColor: 'black'
        }
    },
}

function App(){
    return (
        <Router>
            <div>
                <nav>
                    <ul style={STYLES.UL}>
                        <li>
                            <Link to="/">/histogram</Link>
                        </li>
                        <li>
                            <Link to="/h2">/histogram2</Link>
                        </li>
                    </ul>
                </nav>

                {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
                <Switch>
                    <Route path="/">
                        <Histogram />
                    </Route>
                    <Route path="/h2">
                        <Histogram />
                    </Route>
                </Switch>
            </div>
        </Router>
    );
}





export default App;
